import React from 'react';
import StarRating from './starrating';

//creating a functional component versus a class component of movie
export default function Movie(props){

    return(
    <div className="card">
    <div className="card-body">
    <h4 className="card-img">{props.movie.image}</h4>
    <p className="card-text">{props.movie.synopsis}</p>
    <h5 className="card-subtitle mb-2 text-muted">{props.movie.title}</h5>
    <h6 className="card-subtitle mb-2 text-muted">{this.props.movie.year}</h6>
    <StarRating />
    </div>
    </div>
        );
    };
